    [],nt"num_tags": 6,nt"name": "lake-andes-national-wildlife-refuge-annual-narrative-report-calendar-year-1980",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Lake Andes NWR
    outlines Refuge accomplishments during the 1980 calendar year. The report begins
    with an introduction to the Refuge and information about weather conditions, habitat
    conditions, and the system status. Construction, maintenance, and wildfires are
    also described. Habitat management is covered; croplands, grasslands, and wetlands
    are discussed. The wildlife section of the report discusses migratory birds, mammals,
    and non-migratory birds. Interpretation and recreation activities are outlined;
    topics include information and interpretation, recreation, and law enforcement.
    Field investigations, cooperative programs, items of interest, newspaper articles,
    and Refuge brochures are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
